import React  from "react";

const InputField = ({ value, label, name, placeholder, onChange }) => (
    <div className="form-group">
        <label>{label}</label>
        <input
            value={value}
            name={name}
            className="form-control"
            onChange={onChange}
        />
    </div>
);

export default InputField;
